(116, 1, 'edit', 'news', '{\n    \"new_object\": {\n        \"id\": \"3\",\n        \"slug\": \"lorem-ipsum-simplesmente-uma-simula-o-de-texto-da-ind-stria-tipogr-fica\",\n        \"title\": \"Lorem Ipsum \\u00e9 simplesmente uma simula\\u00e7\\u00e3o de texto da ind\\u00fastria tipogr\\u00e1fica\",\n        \"subtitle\": \"\\u00c9 um fato conhecido de todos que um leitor se distrair\\u00e1 com o conte\\u00fado de texto leg\\u00edvel de uma p\\u00e1gina quando estiver examinando sua diagrama\\u00e7\\u00e3o.\",\n        \"call_text\": \"Existem muitas varia\\u00e7\\u00f5es dispon\\u00edveis de passagens de Lorem Ipsum, mas a maioria sofreu algum tipo de altera\\u00e7\\u00e3o, seja por inser\\u00e7\\u00e3o de passagens com humor, ou palavras aleat\\u00f3rias que n\\u00e3o parecem nem um pouco convincentes. Se voc\\u00ea pretende usar uma passagem de Lorem Ipsum\",\n        \"image\": \"628abc775e59ee59c661c81d65fc139205927edd_2\",\n        \"content\": \"<h2><span xss=removed>O que \\u00e9 Lorem Ipsum?<\\/span><\\/h2>\\r\\n\\r\\n<p><strong>Lorem Ipsum<\\/strong>\\u00a0\\u00e9 simplesmente uma simula\\u00e7\\u00e3o de texto da ind\\u00fastria tipogr\\u00e1fica e de impressos, e vem sendo utilizado desde o s\\u00e9culo XVI, quando um impressor desconhecido pegou uma bandeja de tipos e os embaralhou para fazer um livro de modelos de tipos. Lorem Ipsum sobreviveu n\\u00e3o s\\u00f3 a cinco s\\u00e9culos, como tamb\\u00e9m ao salto para a editora\\u00e7\\u00e3o eletr\\u00f4nica, permanecendo essencialmente inalterado. Se popularizou na d\\u00e9cada de 60, quando a Letraset lan\\u00e7ou decalques contendo passagens de Lorem Ipsum, e mais recentemente quando passou a ser integrado a softwares de editora\\u00e7\\u00e3o eletr\\u00f4nica como Aldus PageMaker.<\\/p>\\r\\n\\r\\n<h2>Porque n\\u00f3s o usamos?<\\/h2>\\r\\n\\r\\n<p>\\u00c9 um fato conhecido de todos que um leitor se distrair\\u00e1 com o conte\\u00fado de texto leg\\u00edvel de uma p\\u00e1gina quando estiver examinando sua diagrama\\u00e7\\u00e3o. A vantagem de usar Lorem Ipsum \\u00e9 que ele tem uma distribui\\u00e7\\u00e3o normal de letras, ao contr\\u00e1rio de \\\"Conte\\u00fado aqui, conte\\u00fado aqui\\\", fazendo com que ele tenha uma apar\\u00eancia similar a de um texto leg\\u00edvel. Muitos softwares de publica\\u00e7\\u00e3o e editores de p\\u00e1ginas na internet agora usam Lorem Ipsum como texto-modelo padr\\u00e3o, e uma r\\u00e1pida busca por &#39;lorem ipsum&#39; mostra v\\u00e1rios websites ainda em sua fase de constru\\u00e7\\u00e3o. V\\u00e1rias vers\\u00f5es novas surgiram ao longo dos anos, eventualmente por acidente, e \\u00e0s vezes de prop\\u00f3sito (injetando humor, e coisas do g\\u00eanero).<\\/p>\\r\\n\\r\\n<p>\\u00a0<\\/p>\\r\\n\\r\\n<h2>De onde ele vem?<\\/h2>\\r\\n\\r\\n<p>Ao contr\\u00e1rio do que se acredita, Lorem Ipsum n\\u00e3o \\u00e9 simplesmente um texto rand\\u00f4mico. Com mais de 2000 anos, suas ra\\u00edzes podem ser encontradas em uma obra de literatura latina cl\\u00e1ssica datada de 45 AC. Richard McClintock, um professor de latim do Hampden-Sydney College na Virginia, pesquisou uma das mais obscuras palavras em latim, consectetur, oriunda de uma passagem de Lorem Ipsum, e, procurando por entre cita\\u00e7\\u00f5es da palavra na literatura cl\\u00e1ssica, descobriu a sua indubit\\u00e1vel origem. Lorem Ipsum vem das se\\u00e7\\u00f5es 1.10.32 e 1.10.33 do \\\"de Finibus Bonorum et Malorum\\\" (Os Extremos do Bem e do Mal), de C\\u00edcero, escrito em 45 AC. Este livro \\u00e9 um tratado de teoria da \\u00e9tica muito popular na \\u00e9poca da Renascen\\u00e7a. A primeira linha de Lorem Ipsum, \\\"Lorem Ipsum dolor sit amet...\\\" vem de uma linha na se\\u00e7\\u00e3o 1.10.32.<\\/p>\\r\\n\\r\\n<p>O trecho padr\\u00e3o original de Lorem Ipsum, usado desde o s\\u00e9culo XVI, est\\u00e1 reproduzido abaixo para os interessados. Se\\u00e7\\u00f5es 1.10.32 e 1.10.33 de \\\"de Finibus Bonorum et Malorum\\\" de Cicero tamb\\u00e9m foram