(1, 'primeira-noticia', 'primeira noticia', 'sub', 'chamada', 'b05639019751b44226d7b992efbb109a5f864eb5_2', '<p>texto</p>\r\n', '2017-05-11', '10:00', 0, 0, 1, '2017-05-12 00:03:23', '2017-05-11 18:50:48', 1),
