INSERT INTO `ws_pharmacovigilance` (`id`, `principal_image`, `principal_image_horizontal_align`, `principal_image_vertical_align`, `principal_image_mobile`, `principal_image_tablet`, `principal_left_text`, `principal_right_text`, `calltonext_section_image`, `call_text_secion`, `left_text`, `right_text`, `button_text`, `deleted`, `order`, `inserted_by`, `date_last_update`, `date_insertion`, `active`) VALUES
(1, 'header-img-1D11JP7UDC', 'right', 'top', 'header-img-9WHST7MV6D', 'header-img-4UMNEPZ5E3', 'FARMACO-<br />\r\nVIGILÂNCIA<br />\r\n', 'Reações e/ou<br />\r\neventos<br />\r\nadversos?', 'call-to-next-1-MH372RX9HU', NULL, '<h4>O que é Farmacovigilância? (definição)</h4>\r\n\r\n<p>A Farmacovigilância é o departamento responsável por garantir e demonstrar a segurança eficácia e qualidade de nossos medicamentos e tem como papel principal coletar, monitorar, pesquisar e avaliar as informações recebidas de profissionais de saúde e pacientes, para compreender e prevenir problemas relacionados aos medicamentos.</p>\r\n\r\n<p>Nosso sistema de Farmacovigilância coleta todas as informações durante o tempo de comercialização de cada um de nossos medicamentos. Ao encontrar qualquer problema com algum medicamento, é feita a comunicação dos eventos com Agências regulatórias, médicos e consumidores, a fim de garantir a integridade de nosso pacientes.</p>\r\n\r\n<h4>Quando notificar?</h4>\r\n\r\n<p>Sempre que forem verificados eventos ou reações adversas descritas ou não em bula durante a administração de medicamentos da Marjan. Os eventos adversos relatados por pacientes e profissionais da saúde são coletados e revisados por equipes de profissionais da Marjan, que investigam caso a caso e contatam o relator, se necessário, para que o problema seja gerenciado da melhor forma possível e medidas cabíveis sejam tomadas para garantir a segurança de nossos pacientes.</p>\r\n\r\n<p> </p>\r\n\r\n<p> </p>\r\n', '<h4>O que informar durante a notificação?</h4>\r\n\r\n<p>No mínimo, as informações necessárias indicadas em nossos formulários. É importante também autorizar o contato posterior da Marjan, para fornecimento de informações e acompanhamento do evento pela Marjan, para que o relato possa ser avaliado pelos profissionais da Marjan.</p>\r\n\r\n<h4>Formas de notificação</h4>\r\n\r\n<p>Neste caso temos duas situações distintas, através do preenchimento de formulário específico para profissionais da saúde ou para não profissionais da saúde (paciente, acompanhante, familiar, etc). Como os requerimentos são diferentes, cada qual tem descrito abaixo as informações mínimas necessárias</p>\r\n\r\n<p>Ou então diretamente através do nº 0800-55-45-45 da Marjan.</p>\r\n', 'ENTRE EM CONTATO<br />\r\nCOM NOSSA ÁREA DE<br />\r\nFARMACOVIGILÂNCIA', 0, 0, 1, '2017-06-12 15:27:55', '2017-06-12 20:27:55', 1);

