1_icon`, `section4_social_media1_text_link`, `section4_social_media1_link`, `section4_social_media2_icon`, `section4_social_media2_text_link`, `section4_social_media2_link`, `deleted`, `order`, `inserted_by`, `date_last_update`, `date_insertion`, `active`) VALUES
(1, 'resp-social-PUQYRF844A', 'right', 'top', 'resp-social-M14W26K243', 'resp-social-KCR3WNJ6E5', 'RESPONSABILIDADE<br/>SOCIAL', 'Acreditamos no<br/>desenvolvimento<br/>sustentável', '2-Z9ASVQEN9B', 'A Marjan Farma acredita na força da iniciativa privada como um<br/>importante agente transformador da sociedade.', '3-GRQFTFBDF8', '3-KV1YBR5H7S', 'right', 'center', '3-4RQBS4T59A', '3-DGH2QBR6R6', 'Instituto Olinto Marques de Paulo', 'A Marjan Farma investe no desenvolvimento integral do Ser Humano, através de diversas ações, entre elas o apoio e compromisso com o Instituto Olinto Marques de Paulo', 'A Marjan Farma investe no desenvolvimento integral do Ser Humano, através de diversas ações, entre elas o apoio e compromisso com o Instituto Olinto Marques de Paulo, Organização Social de Interesse Público que tem por objetivo principal a promoção e o incentivo de projetos ligados à área da Educação, diretamente ou mediante o apoio de entidades com o mesmo foco de atuação, visando sempre a formação de uma sociedade consciente do seu papel transformador.<br/><br/>Por meio do Instituto OMP, através de projetos de resgate e valorização da infância, realizando formação continuada para educadores da rede pública – Educação Infantil e projeto de musicalização para crianças e adolescentes mais de 10 mil pessoas foram beneficiadas diretamente.<br/><br/>E não para por aí, preocupado com o distanciamento das crianças com a natureza, o Instituto OMP com o total apoio da Marjan Farma iniciou o Projeto Arvore Generosa, que visa o plantio de uma árvore para cada criança da cidade de São Paulo. Afinal se o futuro depende das crianças que estão sendo formadas hoje e se essas crianças não brincam na natureza, elas também não se preocuparão em protegê-las.<br/><br/>Deste modo, o Projeto Árvore Generosa, não quer só um plantio de uma árvore, que por si só, já seria maravilhoso. O projeto quer fortalecer a relação entre criança e natureza desde o início de suas vidas, desejando que cada criança tenha sua própria árvore, fomentando sensibilidade, encantamento e respeito.', '4-V2SKST2M1W', 'instituto-omp.org.b', 'http://www.instituto-omp.org.b', 'fb-org-BTUFV3RMSB', 'facebook.com/instituto-omp', 'http://www.facebook.com/instituto-omp', 'ig-org-V75VKY7JTU', 'instagram.com/iomp', 'http://www.instagram.com/iomp', '6-K4JNE37DKG', 'coracao-7JUZ5VR1UY', 'left', 'top', 'coracao-ZYMDX8WXZK', 'coracao-9ZQRPAW3EA', 'Saúde do Coração da Mulher', 'A Marjan Farma apoia a Sociedade Brasileira de Clínica Médica em seu projeto para a conscientização sobre a importância da prevenção de doenças cardiovasculares', 'CAMPANHA SAÚDE DO CORAÇÃO DA MULHER<br/><br/>Até pouco tempo, havia o mito de que problemas do coração eram próprios dos homens. Uma realidade que se alterou bastante nas últimas gerações. Com a mudança no estilo de vida, as mulheres passaram a exercer um novo papel, que representou importante conquista histórica para o sexo feminino. Por outro lado, também atingiu diretamente a saúde do coração, com o consequente aumento do risco de problemas cardíacos.<br/><br/>PORQUE SE PREOCUPAR?<br/><br/>As doenças cardiovasculares na mulher já ultrapassam as estatísticas dos tumores de mama e útero.<br/><br/>Segundo dados recentes da Organização Mundial da Saúde (OMS), respondem por um terço das mortes no mundo, com 8,5 milhões de óbitos por ano, ou seja, mais de 23 mil mulheres por dia.<br/><br/>Entre as brasileiras, principalmente acima dos 40 anos, as cardiopatias chegam a representar 30?s causas de morte, a maior taxa da América Latina.<br/><br/>AQUI A VIDA BATE MAIS FORTE', 'logo-scm-31F85ZWYA5', 'mulhercoracao.com.br', 'http://mulhercoracao.com.br', 'fb-org-7XJP4EPC1A', 'instagram.com/mulhercoracao', 'http://www.facebook.com/mulhercoracao', 'ig-org-2KGTHGSHZP', 'instagram.com/mulhercoracao', 'http://www.instagram.com/mulhercoracao', '7-VN5SVAGMQX', 'arvore-PP9KUKT9Q7', 'right', 'center', 'arvore-GY7SY5VBFS', 'arvore-54S6MBKSQJ', 'Árvore Generosa', 'O Projeto Árvore Generosa quer plantar uma árvore nativa para cada criança de São Paulo. Não só o plantio na terra, mas principalmente no coração da criançada.', 'UMA ÁRVORE PARA CADA CRIANÇA DE SÃO PAULO<br/><br/>O Projeto Árvore Generosa quer plantar uma árvore nativa para cada criança de São Paulo. Não só o plantio na terra, mas principalmente no coração da criançada. Afinal, como bem dizia Rubem Alves “Todo jardim começa com uma história de amor. Antes que qualquer árvore seja plantada, é preciso que ela tenha nascido dentro da alma. Quem não planta jardim por dentro, não planta jardins por fora e nem passeia por eles”.<br/><br/>O objetivo é fortalecer a relação entre criança e natureza desde o início de suas vidas, promovendo sensibilidade, encantamento e respeito, pelo ser vivo (árvore) que está crescendo junto com a criança.<br/><br/>O projeto é realizado por meio de parcerias com iniciativas privadas, poder público e sociedade civil em geral, através de distribuição de mudas nativas e/ou plantios coletivos onde a criança e a família são convidadas para participar.', 'logo-agv-28YWSJZF41', 'arvoregenerosa.org.br', 'http://www.arvoregenerosa.org.br', 'fb-org-CWY8SD8HCZ', 'facebook.com/arvoregenerosa', 'http://www.facebook.com/arvoregenerosa', 'ig-org-XYTDWH2M3T', 'instagram.com/arvoregenerosa', 'http://www.instagram.com/arvoregenerosa', '9-UU2XK9UV4B', '9-X6P8RERWU1', 'left', 'bottom', '9-DQC4MREW89', '9-UJ33X7XTB7', 'GRAVIDEZ SEM ÁLCOOL', 'O consumo de álcool por uma mulher grávida tem grandes possibilidades de atingir o feto, levando-o a apresentar várias alterações em órgãos do corpo, bem como desordens de comportamento que são conhecidas como Síndrome Alcoólica Fetal (SAF) e não têm cura.', 'O consumo de álcool por uma mulher grávida tem grandes possibilidades de atingir o feto, levando-o a apresentar várias alterações em órgãos do corpo, bem como desordens de comportamento que são conhecidas como Síndrome Alcoólica Fetal (SAF) e não têm cura.<br/><br/>Bebês que nascem com SAF têm alterações na face, em órgãos do corpo, podem nascer com peso abaixo do normal e ter retardo mental. Eles têm problemas de aprendizagem, memória, fala, audição, atenção e alterações de comportamento, que se mostram principalmente na idade escolar, e no relacionamento com outras pessoas.<br/><br/>Mas nem todos os bebês apresentam todos os sintomas da SAF!Muitas vezes são reconhecidos tardiamente e recebem várias denominações como SAF parcial ou espectro de alterações relacionadas ao álcool.Em determinadas situações a mãe pode expor o bebê ao álcool antes mesmo de saber que está grávida, por isso é importante não ingerir bebida alcoólica quando há intenção de engravidar.<br/><br/>Se a mãe descobriu a gravidez após ingerir bebida alcoólica, o ideal é parar imediatamente. Nunca é tarde para parar. O quanto antes parar de beber, melhor para a gestante e para o bebê.Mas há que lembrar: A exposição ao álcool durante a gestação não resulta necessariamente em SAF. O principal problema é que não se conhecem níveis seguros de consumo de álcool durante a gravidez, abaixo dos quais o feto não será afetado. Portanto, não há tolerância.', 'logo-saf-W5GV1TXMR4', 'gravidezsemalcool.org.br', 'http://www.gravidezsemalcool.org.br', 'fb-org-KK2EPMQSDT', 'facebook.com/gravidezsemalcool', 'http://www.facebook.com/gravidezsemalcool', 'ig-org-RD2RU9FEFF', 'instagram.com/gravidezsemalcool', 'http://www.instagram.com/gravidezsemalcool', 0, 0, 1, '2017-05-31 12:36:25', '2017-05-31 17:36:25', 1);

